export const googleAnaliticsMock = {
    vistasPagina: [
        { fecha: "2024-08-01", vistas: 300 },
        { fecha: "2024-08-02", vistas: 450 },
        { fecha: "2024-08-03", vistas: 600 },
        { fecha: "2024-08-04", vistas: 230 },
        { fecha: "2024-08-05", vistas: 550 }
    ],
    sesiones: [
        { fecha: "2024-08-01", sesiones: 200, tasaRebote: 0.35 },
        { fecha: "2024-08-02", sesiones: 300, tasaRebote: 0.40 },
        { fecha: "2024-08-03", sesiones: 350, tasaRebote: 0.45 },
        { fecha: "2024-08-04", sesiones: 150, tasaRebote: 0.20 },
        { fecha: "2024-08-05", sesiones: 280, tasaRebote: 0.35 },
        { fecha: "2024-08-06", sesiones: 580, tasaRebote: 0.40 },
    ],
    demografía: {
        edad: [
            { rango: "18-24", porcentaje: 25 },
            { rango: "25-34", porcentaje: 40 },
            { rango: "35-44", porcentaje: 15 },
            { rango: "45-54", porcentaje: 5 },
        ],
        genero: [
            { tipo: "hombre", porcentaje: 55 },
            { tipo: "mujer", porcentaje: 45 }
        ]
    }
}
